import Navbar from './Navbar'
import Home from './pages/Home'
import About from './pages/About'
import Cart from './pages/Cart'

function App() {
  let com
  // eslint-disable-next-line default-case
  switch(window.location.pathname){
    case "/": 
      Component = <Home />
      break
    case "/about":
     Component = <About />
      break
    case "/cart":
      Component = <Cart />
      break
  }
  return (
  <>
     <Navbar />
     <Component />
  </>
)

}

export default App;
